import React from 'react';


const Navbar = () =>{
    return(
        <div>
            <div className='leftSide'>
                <img src='./Components/images/Logo.png' alt='' />
            </div>
            <div className='rightSide'></div>
        </div>
    );
}

export default Navbar;
